import "./product.css";
import Krishe from "../../img/Krish-e.PNG"

const Product = () => {
  {
    return (
      <div className="p">
        <div className="p-left">
          <div className="p-card">
          </div>
        </div>
        <div className="p-right">
          <h1 className="p-title">Research and Project Overview</h1>
        </div>
      </div>
    );
  };
};

export default Product;
